import React from 'react';
import { Layout, Table, Icon, Button, DatePicker } from 'antd';

const { RangePicker } = DatePicker;

function onChange(date, dateString) {
  console.log(date, dateString);
}

const dataSource = [
  {
    key: '1',
    file: '2020-01-09.csv',
  },
  {
    key: '2',
    file: '2020-01-08.csv',
  },
];

const columns = [
  {
    title: 'File',
    dataIndex: 'file',
    key: 'file',
  },
  {
    title: '',
    key: 'actions',
    width: 100,
    render: (text, record) => (
      <span>
        <a href="/"> <Icon type="download" /> Download</a>
      </span>
    )
  },
];

class App extends React.Component {
  state = {
    loading: false,
    iconLoading: false,
  };

  enterLoading = () => {
    this.setState({ loading: true });
  };

  enterIconLoading = () => {
    this.setState({ iconLoading: true });
  };
}

const Reports = () =>
  <>
  <Layout style={{ margin: 20, background: 'white'}}>
    <section>
      <Button type="primary" loading={this.state.loading} onClick={this.enterLoading}>
        Click me!
      </Button>
      <h2>Generate reports:</h2>
      <div>
        Generate report of all trades made today: <Button type="primary">Generate</Button>
      <br />
      <br />
        Generate report between specific dates: <RangePicker onChange={onChange} />
      </div>
    </section>
    <section style={{textAlign: 'left', marginTop: 20 }}>
      <h1 style={{textAlign: 'left'}}>Previously Generated Reports</h1>
    </section>
    <Table dataSource={dataSource} columns={columns} size="middle" />
  </Layout>
  </>

export default Reports
